import { BrowserRouter as Router, Routes, Route } from "react-router-dom";
import { useState, useEffect } from "react";
import Tournaments from "./components/Tournaments";
// import Home from "./pages";
import EditTournament from "./components/EditTournament";
// import Tournament from "./pages/tournament";
// import Tournaments from "./components/Tournaments";

const App = () => {
  const [tournaments, setTournaments] = useState("");

  useEffect(() => {
    const getTournaments = async () => {
      const tournamentsFromServer = await fetchTournaments();
      setTournaments(tournamentsFromServer);
    };

    getTournaments();
  }, []);

  const handleInputChange = (event) => {
    const target = event.target;
    const name = target.name;
    const value = target.value;
    setInputs((values) => ({ ...values, [name]: value }));
  };

  // Fetch Tournaments
  const fetchTournaments = async () => {
    const res = await fetch("http://localhost:5000/tournaments");
    const data = await res.json();

    return data;
  };

  // Fetch Tournament
  const fetchTournament = async (name) => {
    const res = await fetch(`http://localhost:5000/tournaments/${name}`);
    const data = await res.json();

    return data;
  };

  // Add Tournament
  const addTournament = async (tournament) => {
    const res = await fetch("http://127.0.0.1:5000/tournaments", {
      method: "POST",
      headers: {
        "Content-type": "application/json",
      },
      body: tournament,
    });

    const data = await res.json();

    setTournaments([...tournaments, data]);
  };

  // Delete Tournament
  const deleteTournament = async (id) => {
    const res = await fetch(`http://localhost:5000/tournaments/${id}`, {
      method: "DELETE",
    });
    //We should control the response status to decide if we will change the state or not.
    res.status === 200
      ? setTournaments(tournaments.filter((tournamenasdft) => tournament.id !== id))
      : alert("Error Deleting This Tournament");
  };

  const handleCreateTournament = async (event) => {
    event.preventDefault();
    const tournament = JSON.stringify({
      name: inputs.tournamentName,
      type: inputs.tournamentType,
      participants: inputs.numberOfParticipants,
    });
    await addTournament(tournament);
  };

  return (
    <Router>
      <Routes>
        <Route
          exact
          path="/"
          element={
            <Container>
              <Navbar />
              <Row className="align-items-center">
                <Col>
                  <Form className="register-form">
                    <Form.Group controlId="tournamentName">
                      <Form.Label>TOURNAMENT NAME:</Form.Label>
                      <Form.Control
                        type="text"
                        placeholder="Enter tournament name"
                        name="tournamentName"
                        onChange={handleInputChange}
                      />
                    </Form.Group>
                    <Form.Group controlId="tournamentType">
                      <Form.Label>TOURNAMENT TYPE:</Form.Label>
                      <Form.Control
                        type="text"
                        placeholder="Enter tournament type"
                        name="tournamentType"
                        onChange={handleInputChange}
                      />
                    </Form.Group>
                    <Form.Group controlId="numberOfParticipants">
                      <Form.Label>NUMBER OF PARTICIPANTS:</Form.Label>
                      <Form.Control
                        type="number"
                        placeholder="4"
                        name="numberOfParticipants"
                        onChange={handleInputChange}
                      />
                    </Form.Group>
                    <Button
                      onClick={handleCreateTournament}
                      className="btn"
                      id="inputButton"
                    >
                      CREATE TOURNAMENT
                    </Button>
                  </Form>
                </Col>
                <Col lg={1}></Col>
                <Col>
                  <Form className="enter-form">
                    <Form.Group controlId="existingTournamentName">
                      <Form.Label>TOURNAMENT NAME:</Form.Label>
                      <Form.Control
                        type="text"
                        placeholder="Enter tournament name"
                        name="existingTournamentName"
                        onChange={handleInputChange}
                      />
                    </Form.Group>
                    <Button
                      onClick={<EditTournament tournamentName={inputs.existingTournamentName}/>}
                      className="btn"
                      id="inputButton"
                    >
                      OPEN TOURNAMENT
                    </Button>
                    <Button
                      onClick={<EditTournament tournamentName={inputs.existingTournamentName}/>}
                      className="btn"
                      id="inputButton"
                    >
                      EDIT TOURNAMENT
                    </Button>
                  </Form>
                </Col>
              </Row>
            </Container>
          }
        />
        <Route path="/edit-tournament" element={<EditTournament />} />
        {/* <Route path="/tournament" element={<Tournament />} /> */}
      </Routes>
    </Router>
  );
};

export default App;
